import styled,{ThemeProviver} from "styled-components";
import { darkTheme } from "./utils/Theme";
import Home from "./pages/Home";
import {BrowserRouter} from "react-router-dom"
const Container = styled.div`
width:100%;
height:100%;
display:flex;
background:${({theme})=>theme.bg};
color:${({ theme })=> theme.text_primary};
    overflow-x : hidden;
    overflow-y : hidden;
    transition : all 0.2s ease;
`;
const Wrapper = styled.div`
    height:100%;
    position:relative;
    display:flex;
    flex-direction: column;
    justify-content : space-between;
    flex: 3;

    `
function App() {
 return (
  <ThemeProviver theme={darkTheme}>
    <Container>
      <Wrapper>
        <BrowserRouter>
        </BrowserRouter>
        <Home/>
      </Wrapper>
    </Container>
  </ThemeProviver>
 )

}

export default App;
